import React,{useEffect,useState} from "react";
import Content from "./Content";
import Kabinet from "./testRoute";
import './styles/App.css';
import {
  BrowserRouter as Router,
  Routes,

  Route,

} from 'react-router-dom';
import Main from "./main";
import Login from "./Login_Popup";
import userEvent from "@testing-library/user-event";


function App() {

  let main=window.location.href+"main"
  let regist=window.location.href+"regist"
  return (
    <>
   <div className="firtst_div" >


   <div className="header">
    <h1>//////Сars_sale - продажа авто с пробегом</h1>
    <a  href="/" ><button className="cabinet_button" >Главная страница</button></a>
    <a  href={main} ><button className="cabinet_button" >Личный кабинет</button></a>
    <a href={regist}><button className="cabinet_button" >Регистрация</button></a>
   </div>

   <div >
   <Routes>
        <Route path="/" element={<Content/>}>
          </Route>

   </Routes>
</div>
<Routes>
<Route path="/main" element={<Kabinet/>}>
</Route>
<Route path="/regist" element={<Login />}>
          </Route>


</Routes>

    </div>

    <footer className="footer">
<ol>
        <li>г. Таганрог, ул. Маршала Жукова 2а-7</li>
        <li>ИП Минко Виктор Олегович</li>
        <li>Телефон: 89515008140</li>
    </ol>

</footer>


</>
  );
}

export default App;
